 the Seahawks' 28-21 win over the Cardinals on Thursday night.\",\"analysis\":\"Lockett toughed out a knee sprain that had reportedly cause him some early-week swelling to pace all pass catchers on either squad in receptions and receiving yardage on the night. The 28-year-old was also the Seahawks' leader in targets and recorded his eighth touchdown reception of the season on a nifty second-quarter grab in the right corner of the end zone. Lockett's score was his first since Week 7, when he's crossed the goal line on three occasions against this same Cardinals squad. He'll now have extra time off his feet before a Week 12 Monday night matchup versus the Eagles on Nov. 30.\",\"title\":\"Thrives despite limitations\"},{\"timeEpochMilli\":\"1605850132000\",\"contents\":\"Seattle Seahawks wide receiver Tyler Lockett had been going through a bit of a cold stretch over the last few weeks, but he finally returned to relevance in Week 11 against the Arizona Cardinals on Thursday. He caught all nine of his targets for 67 yards and a touchdown. He and teammate D.K. Metcalf continue to alternate their big games, although Metcalf could have had one this week with better hands on two occasions. But it was good to see Lockett show some life again. The Seahawks have four ...\",\"url\":\"https://www.rotoballer.com/player-news/tyler-lockett-comes-back-to-life-in-week-11/806105\",\"title\":\"Tyler Lockett Comes Back To Life In Week 11\"}],\"nameFirst\":\"Tyler\",\"nameLast\":\"Lockett\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"status\":\"FINAL_SCORE\",\"awayScore\":21,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochM