hip) and Danny Amendola (hip) and top running back D'Andre Swift (concussion) are all inactive for the contest.\",\"title\":\"Officially suiting up Sunday\"},{\"timeEpochMilli\":\"1606063506000\",\"contents\":\"Detroit Lions quarterback Matthew Stafford (thumb) is officially active for Sunday's game against the Carolina Panthers. No surprise here, as Stafford was trending towards playing all week. He won't have two of his top pass-catchers in Kenny Golladay and Danny Amendola, so Stafford won't be the safest play, but the Panthers Defense is exploitable and he can be a solid streaming play.\",\"url\":\"https://www.rotoballer.com/player-news/matthew-stafford-active-for-week-11/806726\",\"title\":\"Matthew Stafford Active For Week 11\"}],\"nameFirst\":\"Matthew\",\"nameLast\":\"Stafford\",\"proTeam\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"IN_PROGRESS\",\"segment\":1,\"segmentSecondsRemaining\":362,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"stateFootball\":{\"down\":1,\"distance\":10,\"fieldLine\":31,\"fieldLineAbsolute\":31,\"description\":\"1st & 10 at CAR 31\"}},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":25.0,\"formatted\":\"1/4\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":7.0,\"formatted\":\"7\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"formatted\":\"0\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"